import "./LogInStyle.css";
import "../components/GrowItem.scss";
import { Link } from "react-router-dom";

import {useContext } from "react";
import  AuthContext  from '../context/authContext';
const ConnectAdmin = () => {
  const auth = useContext(AuthContext);
  function enterAsCoach(){
    auth.enterAs = "coach";
  }
  function enterAsSup(){
    auth.enterAs = "sup";
  }
  function enterAsAdmin(){
    auth.enterAs = "admin";
  }
  return (
  
      <div>
      <header>
        <table className="nav">
          <tr>
            <th>
              {" "}
              <img alt="" className="logo" src="images/oyemkemlavert.png" />
            </th>
          </tr>
        </table>
      </header>

      <section className="main">
        <p className="sign">Se Connecter En Tant Que :</p>

        <table>
          <tr>
            <th>
              <img alt="" className="image" src="images/oyemvertblanc.jpg" />
            </th>
            <th>
              <form className="form1" />
              
                <div class="screen">
                <Link to="/accueil" class="mainn growCard" onClick={enterAsAdmin}>
                    <p class="typeUser">Administrateur</p>
                  </Link>
                  <Link to="/accueil"  class="mainn growCard" onClick={enterAsSup}>
                    <p class="typeUser">Superviseur</p>
                  </Link>
                  <Link to="/accueil"  class="mainn growCard" onClick={enterAsCoach}>
                    <p class="typeUser">Coach</p>
                  </Link>
                </div>
              
              <br />
              <div></div>
            </th>
          </tr>
        </table>
      </section></div>
    
  );
};
export default ConnectAdmin;
